import React, {useEffect, useState} from 'react'
import LoadingPlane from './LoadingPlane'

const ListRandom = () => {
  const [loading, setLoading] = useState(false)
  const [randomNsn, setRandomNsn] = useState()

  const fetchRandom = ()=> {
      setLoading(true)
      fetch('/api/random_list')
      .then(res => res.json())
      .then(data => {
        setRandomNsn(data)
        setLoading(false)
      })
      .catch(err => {
        console.log(err)
        setLoading(false)
      })
  }

  const nsnList = (
    <ul>
      {randomNsn ? randomNsn.map(obj => {
          return (
            <li className='nsn-item'>
              <a href={`/nsn/${obj.nsn}`} className='nsn-link'>
                NSN &nbsp;{obj.nsn}
              </a>
            </li>
          )
        }) 
      : undefined}
    </ul>
  )

  useEffect(()=>{
    fetchRandom()
  }, [])

  return ( 
    <div className='random-list'>
      <h1>Random List of 15 NSN</h1>
      {loading ? <LoadingPlane /> : nsnList}
    </div>
   );
}
 
export default ListRandom;
